{"0": ["Заказал 2 колеса пришло одно. где моё второе колесо  3,14дарасы?", "2021-01-10T08:20:02Z", "", "0", 1, 1, 1, "Автомобильная шина КАМА Кама-505", "Кама"], "1": ["Шумят .\nПришли 3 из четырёх. Четвёртое отгружено 15 декабря.... До сих пор идёт. Да и вообще смотрите фото, что пишут! Три могут, а четвёртое не может...", "2021-01-05T11:52:34Z", "", "0", 1, 0, 4, "Автомобильная шина КАМА Кама-505", "Кама"], "2": ["Прям детективная история с этими покрышками.Первый раз пришли 3 штуки,одну вернули не тот  размер.Перезаказала и вот с 6 .12.20 всё идёт...или едет.То уже в Смоленске,потом опять только ОТГРУЖЕНО поставщиком.Покрышки то хорошие,только куда они деваются???", "2020-12-12T09:15:35Z", "", "0", 2, 0, 5, "Автомобильная шина КАМА Кама-505", "Кама"], "4": ["Единственный и огромный минус, заказали 4 колеса. 3 шт доставили одно так где-то и едет. Пришлось делать отказ.", "2020-12-24T11:48:25Z", "", "0", 1, 0, 5, "Автомобильная шина КАМА Кама-505", "Кама"], "5": ["Заказывал 4 колеса пришло три на 14 четвëртого колеса до сих пор нет в Тюмени ожидает с 21.12.2020,хотя по отслеживания все четыре колеса были в комплекте.", "2020-12-22T14:57:39Z", "", "0", 2, 0, 1, "Автомобильная шина КАМА Кама-505", "Кама"], "6": ["Как и в предыдущих случаях всё описанное, получил 15 декабря три колеса, четвёртое не меняет свой статус «Заказ отгружен поставщиком» вторую неделю. Жду у моря погоды... Wildberries! Может что-то в консерватории надо подправить?", "2020-12-22T09:32:54Z", "", "0", 2, 0, 1, "Автомобильная шина КАМА Кама-505", "Кама"], "8": ["С 7го декабря, одна пришла, вторая потерялась. На одной как ездить??", "2020-12-19T18:56:02Z", "", "0", 1, 0, 1, "Автомобильная шина КАМА Кама-505", "Кама"], "9": ["У меня проблема тоже, одна пришла другая до сих пор идёт", "2020-12-18T09:31:33Z", "", "0", 2, 0, 3, "Автомобильная шина КАМА Кама-505", "Кама"], "10": ["Заказал 4 покрышки 14 радиуса, пришли 3 14 радиуса и 1 13 радиуса, возврат делать отказались", "2020-12-13T16:13:17Z", "", "0", 3, 0, 2, "Автомобильная шина КАМА Кама-505", "Кама"], "11": ["Заказали 4 шины, две пришло, а две потерялись на складе в Туле, с 15 ноября.", "2020-11-29T05:23:16Z", "", "0", 3, 0, 3, "Автомобильная шина КАМА Кама-505", "Кама"]}
